import React from 'react';
import Image from 'react-bootstrap/Image';
import {Container} from 'react-bootstrap';


const Main = () => {
    return (
        <Container>
            <Row>
                <Col xs={6} md={4}>
                <Image src="https://unsplash.com/photos/4SLz_RCk6kQ" rounded />
                </Col>
            </Row>
        </Container>
    )
}

export default Main;
